import React, { useState, useRef, useEffect } from 'react';
import { useDispatchCart, useCart } from '../components/ContextReducer';

export default function Card(props) {
    const dispatch = useDispatchCart();
    const [qty, setQty] = useState(1);
    const [size, setSize] = useState("");
    const priceRef = useRef();
    const options = props.options || {}; 
    const priceOptions = Object.keys(options);

    // Handle initial size selection on mount
    useEffect(() => {
        if (priceOptions.length > 0) {
            setSize(priceOptions[0]);
        }
    }, [priceOptions]);

    const handleQty = (e) => {
        setQty(Number(e.target.value)); // Ensure the value is a number
    };

    const handleOptions = (e) => {
        setSize(e.target.value);
    };

    const handleAddtoCart = () => {
        if (size) { 
            const finalPrice = qty * parseInt(options[size] || 0);
            dispatch({
                type: "ADD",
                id: props.foodItem._id,
                name: props.foodItem.name,
                price: finalPrice,
                qty: qty,
                size: size
            });

            // Show a success confirmation (could be replaced with a toast)
            alert(`${props.foodItem.name} has been added to your cart.`);
        } else {
            alert("Please select a size before adding to the cart.");
        }
    };

    return (
        <div>
            <div className="card mt-3 bg-dark text-light" style={{ width: "16rem", maxHeight: "360px" }}>
                <img
                    src={props.foodItem.img}
                    className="card-img-top"
                    alt={props.foodItem.name}
                    style={{ height: "120px", objectFit: "cover" }}
                />
                <div className="card-body">
                    <h5 className="card-title">{props.foodItem.name}</h5>
                    <div className="container w-100 p-0 d-flex flex-column gap-2" style={{ height: "38px" }}>
                        <div className="d-flex align-items-center gap-2">
                            <select
                                className="m-2 h-100 bg-success text-white rounded"
                                onChange={handleQty}
                                value={qty}
                                aria-label="Select quantity"
                            >
                                {Array.from(Array(6), (_, i) => (
                                    <option key={i + 1} value={i + 1}>{i + 1}</option>
                                ))}
                            </select>
                            <select
                                className="m-2 h-100 bg-success text-white rounded"
                                ref={priceRef}
                                onChange={handleOptions}
                                value={size}
                                aria-label="Select size"
                            >
                                {priceOptions.map((option) => (
                                    <option key={option} value={option}>{option}</option>
                                ))}
                            </select>
                        </div>
                        <div className="d-inline ms-2 h-100 w-20 fs-5 text-white">
                            ₹{qty * (parseInt(options[size] || 0))}/-
                        </div>
                    </div>

                    <hr className="bg-secondary" />
                    <button
                        className="btn btn-success w-100"
                        onClick={handleAddtoCart}
                    >
                        Add to Cart
                    </button>
                </div>
            </div>
        </div>
    );
}
